INSERT INTO toa_sms_receive VALUES ('7256','243','2014-06-30 14:41:29','张局长，关于结对认亲网站，上次开会听了您的思路，下面是我初步设想的首页界面（还未经过领导审批），请您批阅。关于捐款，我的理解是：任何钱不走我们网页上过，甚至连银行路径都不推荐，网站只提供贫困者信息，捐款人通过自己的渠道捐赠。我本来是按这样理解，但有相关提出，这样无法统计捐赠数量和金额，达不到效果。为了能统计帮扶效果、兼顾两者的意见，我在沟通了省银联后，银联初步同意为我们搭建一专门平台，若捐赠者愿意捐款，通过我们网页直接链接到银联的付款平台，进行卡对卡的捐款。所有捐赠在银联界面中进行，资金由捐助者银行卡直接划到被捐人的卡上，原则上脱离了“结对认亲”网页。因时间关系，设想还未经过各级领导审核，现冒昧越级上报，是希望听到张局长的宝贵意见，好完善网页设计。请张局长只做参考<a href=\"data/uploadfile/243/20140630/20140630061221.jpg\" target=\"_blank\">附件下载</a>','4','2','1','','4708','1');
